css:
@-moz-document url-prefix("https://developer.roblox.com/") {
body{
 background-color: #333333;   
}
.header, .featured-banner, .home .section, .bd-content, .bd-toc, .bd-toc-wrap{
 background: #333333;   
}
.header .search-box{
 border-left: 1px solid #363636;   
}
.header .search-box .form-control{
 background: #636363;   
}
.home .section .section-title{
 color: #aaaaaa;   
}
.focus-on-gameplay .card-deck .card{
 background: #636363;   
}
.swiftype-widget .autocomplete > div, .learn-roblox-pages .learning-materials-content .nav-tabs-wrap,.learn-roblox-pages .learning-materials-content .nav-tabs, .custom-select-box.select2-container .select2-choice{
 background: #636363;
}
.swiftype-widget .autocomplete, .custom-select-box.select2-container .select2-choice{
    border: 0px;
}
.header .bd-navbar-nav .nav-item > a{
 color: #aaaaaa;   
}
.learn-roblox-pages .intro{
 border-bottom: 2px solid #636363   
}
.custom-select-dropdown.select2-drop-active{
 background: #333333;
    border: 0px
}
.learn-roblox-pages .bd-sidebar .bd-links .bd-toc-item-wrap:first-child, .bd-sidebar .bd-toc-link, .bd-sidebar-wrap .toggle-sidebar a, .bd-links, .bd-sidebar-wrap, .bd-sidebar .bd-search{
 background: #262626; 
    color: #aaaaaa;
}
.bd-toc .toc-nav .inner-toc-nav{
 border-left: 2px solid #666666;   
}

.tags-wrap li{
 background: #333333;   
}
.form-control, code{
 background: #636363;
    border: 0px
}

.footer{
 background-color: #636363;   
}
.markdown-field-data p, h1, h2, h3, h4, h5, h6{
 color: #aaaaaa;   
}
}
